import React from 'react';
import ListCharac from './ListCharac';
import Filters from './Filters';


const Home = props => {
    const {data, getQuery, query} = props;
    return (
        <React.Fragment>
            <Filters getQuery={this.getQuery}/>
            <ListCharac 
            data={this.state.data} 
            query={this.state.query}/>
        </React.Fragment>
    );
};


export default Home;
